import React from 'react';
import './Cards.css';
import CardItem from './CardItem';
import img1 from './images/image7.jpg';
import img2 from './images/image1.jpeg';
function Cards() {
  return (
    <div className='cards'>
      <h1></h1>
      <div className='cards__container'>
        <div className='cards__wrapper'>
          <ul className='cards__items'>
            <CardItem
              src={img1}
              text='Diabetes Care'
            />
            <p>SugarWise is a comprehensive web platform designed to empower healthcare professionals in making informed decisions for their diabetic patients. We provide a suite of advanced tools and resources to streamline the diagnosis confirmation process and optimize medication recommendations.</p>
            <CardItem
              src={img2}
              text='AI- powered'
            />
          </ul>
          <ul className='cards__items'>
            <CardItem
              src={img1}
